	add("pancake", "{\"term\":\"pancake\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) 1430, {{compound|pan|cake|lang\u003den}}. The juggling sense is by analogy with a pancake being tossed in a pan.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin batter cake fried in a pan or on a griddle in oil or butter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A kind of makeup, consisting of a thick layer of a compressed powder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A type of throw, usually with a ring where the prop is thrown in such a way that it rotates round an axis of the diameter of the prop\", \"priority\":3}]}, \"synonyms\":{}}");

	add("panchayat", "{\"term\":\"panchayat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Hindi पंचायत.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A village council or local government in South Asia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: “You\u0027re in the \u0027\u0027panchayat\u0027\u0027,” she said. “So couldn\u0027t you make that official?” — Salman Rushdie, \u0027Shalimar the Clown\u0027 (Vintage 2006, p. 233\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pancrack", "{\"term\":\"pancrack\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"social Social security, especially as paid to the unemployed; the dole\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Delta: A Literary Review from Cambridge\u0027, Issues 49-54, [https://books.google.ca/books?id\u003dCrkqAQAAIAAJ\u0026amp;q\u003dpancrack+-egg+-eggs\u0026amp;dq\u003dpancrack+-egg+-eggs\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ved\u003d0CDUQ6AEwBjgoahUKEwiN8Zv06pjHAhVDyT4KHfp7AOo p. 38 (Google snippet view\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is \u0027\u0027Pancrack\u0027\u0027 day or so they call it. Dole money or social security which is often more for those who have done no work at all\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Union Street\u0027, ISBN 9780860682837\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had saved it out of her social security money: the \u0026quot;\u0027\u0027pancrack\u0027\u0027\u0026quot; as she contemptuously called it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027Common As Muck\u0027, ISBN 9781405520478, [https://books.google.ca/books?id\u003dxKY0AgAAQBAJ\u0026amp;pg\u003dPT67\u0026amp;lpg\u003dPT67\u0026amp;dq\u003d%22Common+as+Muck%22+pancrack\u0026amp;source\u003dbl\u0026amp;ots\u003dfj9UQFdQ-R\u0026amp;sig\u003dZUgLkmrO05cOGhDmgUsn5BlMSV8\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ved\u003d0CB4Q6AEwAGoVChMI86C2iuqYxwIVBMk-Ch2sOg7\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Common%20as%20Muck%22%20pancrack\u0026amp;f\u003dfalse ch. 6 (Google preview\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;I\u0027ll go on the \u0027\u0027pancrack\u0027\u0027,\u0026quot; I told the foreman, but when I got to the dole office they told me I wouldn\u0027t need to sign on\", \"priority\":8}]}, \"synonyms\":{}}");

	add("pancreas", "{\"term\":\"pancreas\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Existing in English since the sixteenth century: from Latin \u0027pancreas\u0027 from Ancient greek (to 1453) \u0027πάγκρεας\u0027 () from \u0027πᾶν\u0027 (all) (equivalent to English \u0027pan-\u0027 + \u0027κρέας\u0027 (flesh) \u0026lt;ref name\u003d\u0026quot;COED-etym\u0026quot;\u0026gt;The \u0027\u0027Concise Oxford English Dictionary\u0027\u0027, 11\u0026lt;sup\u0026gt;th\u0026lt;/sup\u0026gt; ed.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gland near the stomach which secretes a fluid into the duodenum to help with food digestion. The fluid contains protease, carbohydrase and lipase, which breaks down larger molecules into smaller pieces. The pancreas also produces the hormones insulin and glucagon which regulate blood sugar. These hormones are released into the cardiovascular system\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pancreaticoduodenectomy", "{\"term\":\"pancreaticoduodenectomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|pancreatic|duodenum|lang\u003den}} {{suffix||ectomy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The surgical procedure for the removal of part of the pancreas and part of the stomach including the duodenum\", \"priority\":1}]}, \"synonyms\":{}}");

