	add("panda", "{\"term\":\"panda\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027panda\u0027 apparently from a local language in Nepal.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The red panda, a small raccoon-like animal, \u0027Ailurus fulgens\u0027 of northeast Asia with reddish fur and a long, ringed tail\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The giant panda – a black and white bear-like animal, \u0027Ailuropoda melanoleuca\u0027 from the mountains of China\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A police car\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pandal", "{\"term\":\"pandal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Tamil\"], \"text\":\"From Tamil \u0027பந்தல்\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large temporary structure in South Asia erected during various Hindu and Buddhist religious festivals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pandan", "{\"term\":\"pandan\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"French\", \"Haitian Creole\"], \"text\":\"From French \u0027pendant\u0027 (during)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Pandanus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pandanus", "{\"term\":\"pandanus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malay\"], \"text\":\"From Malay \u0027pandan\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The screw pine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:William Somerset W. Somerset Maugham, \u0027w:The Moon and The Moon and Sixpence\u0027, s:The Moon and Sixpence/Chapter chapter 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A girl of fifteen, perhaps, was plaiting \u0027\u0027pandanus\u0027\u0027-leaf to make a hat, and an old woman was sitting on her haunches smoking a pipe\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pandar", "{\"term\":\"pandar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Chaucer’s character w:Pandarus|Pandare (in \u0027w:Troilus and Criseyde|Troilus and Criseyde\u0027), from Italian w:Pandarus|Pandaro (found in w:Boccaccio|Boccaccio), from Latin w:Pandarus|Pandarus, from Ancient greek (to 1453) \u0027πάνδαρος\u0027 (See also Shakespeare’s \u0027wikibooks:Troilus and Cressida|Troilus and Cressida\u0027.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who furthers the illicit love-affairs of others; a pimp or procurer, especially when male\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pandeiro", "{\"term\":\"pandeiro\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"Portuguese\"], \"text\":\"From Portuguese {{m|pt|pandeiro}}, from Latin {{m|la|pandurium}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of hand-held frame drum with a round wooden frame and six pairs of metal discs fit along the sides, and an animal skin or nylon head; similar to a tambourine but with head tension that can be tuned and crisper, drier, and less sustained jingles, used in a number of Brazilian music forms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A square double skinned frame drum, often with a bell inside, used in medieval Spanish/Moorish music\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pandeism", "{\"term\":\"pandeism\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"A {{blend|pantheism|deism|nocap\u003d1|lang\u003den}}; or possibly from German \u0027pandeismus\u0027 or Italian \u0027pandeismo\u0027 from Ancient greek (to 1453) \u0027πάν\u0027 (all) and Latin \u0027deus\u0027 (god) First appearance in a dictionary was in 1849.\u0026lt;!-- First used in the variation \u0026quot;Pandeisten\u0026quot; (pandeists) by w:Moritz Lazarus|Moritz Lazarus and w:Heymann Steinthal|Heymann Steinthal in \u0027Zeitschrift für Völkerpsychologie und Sprachwissenschaft\u0027 (1859), p. 262.--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coherent belief in a God who is both pantheistic and deistic, e.g. a God who designed the universe and then created it by becoming\u0027 the universe, thus ceasing to act consciously with respect to the universe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, w:Charles Charles Hartshorne, \u0027Man\u0027s Vision of God and the Logic of Theism\u0027, p. 348\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Just as [absolute perfection in some respects, relative perfection in all others] is the whole positive content of perfection, so CW, or the conception of the Creator-and-the-Whole-of-what-he-has-created as constituting one life, the super-whole which in its everlasting essence is uncreated (and does not necessitate just the parts which the whole has) but in its de facto concreteness is created - this panentheistic doctrine contains all of deism and \u0027\u0027pandeism\u0027\u0027 except their arbitrary negations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, w:F.E. Francis E. Peters, \u0027Greek Philosophical Terms: A Historical Lexicon\u0027, p. 169\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"What appeared here, at the center of the Pythagorean tradition in philosophy, is another view of \u0027psyche\u0027 that seems to owe little or nothing to the pan-vitalism or \u0027\u0027pan-deism\u0027\u0027 (see \u0027theion\u0027) that is the legacy of the Milesians\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Pastor Bob Burridge, \u0027[http://www.girs.com/library/theology/syllabus/theo4.html Theology Proper - Lesson 4: The Decrees of God\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The reality of secondary causes is what separates Christian theism from \u0027\u0027pandeism\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Donald L. Jackson, \u0027Religious Lies - Religious Truths: It\u0027s Time To Tell The Truth!\u0027, page 175\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Charles Hartshorne introduced his process theology in the 1940s, in which he examined, and discarded pantheism, deism and \u0027\u0027pandeism\u0027\u0027 in favor of panentheism, finding that such a doctrine contains all of deism and \u0027\u0027pandeism\u0027\u0027 except their arbitrary negative aspects\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Worship which admits or tolerates favorable aspects of all religions; omnitheism\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:Yale Yale University w:Sheffield Scientific Sheffield Scientific School, \u0027Yale Sheffield Monthly\u0027, p. 463\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"We hear men prophecy that this war means the death of Christianity and an era of \u0027\u0027Pandeism\u0027\u0027 or perhaps even the destruction of all which we call modern civilization and culture. We hear men predict that the ultimate result of the war will be a blessing to humanity\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, w:J. Sidlow J. Sidlow Baxter, \u0027[http://www.pwmi.org/index.php?option\u003dcom_content\u0026amp;view\u003darticle\u0026amp;id\u003d137:our-bible-the-most-critical-issue\u0026amp;catid\u003d23:general-articles\u0026amp;Itemid\u003d252 Our Bible: The Most Critical Issue\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"If the Bible is only human lore, and not divine truth, then we have no real answer to those who say, \u0027Let\u0027s pick the best out of all religions and blend it all into \u0027\u0027Pan-Deism\u0027\u0027 - one world religion with one god made out of many\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Conrad Baker, \u0027[http://www.maranathamedia.com.au/start/index.php?option\u003dcom_docman\u0026amp;task\u003ddoc_details\u0026amp;gid\u003d997 The Three Powers Of Armageddon ]: An Exposition of Revelation 16:13-16\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The Church of Rome uses the term \u0026quot;\u0027\u0027pandeism\u0027\u0027\u0026quot;, to describe her current program of bringing under her wing the non-Christian religions of the world\", \"priority\":16}]}, \"synonyms\":{}}");

	add("pandemain", "{\"term\":\"pandemain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027panis domini\u0027, lord\u0027s bread.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A high-quality white bread, baked from the finest sifted flour, suitable for the lord of the manor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Candace Robb, \u0027The Cross-Legged Knight‎\u0027, p. 102\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;I have made \u0027\u0027pandemain\u0027\u0027 for the injured one. Easy to chew.\u0026quot; \u0026quot;I hope he wakes to relish it. He will not have such a treat again, I warrant\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Sara Paston-Williams, \u0027The Art of Dining: A History of Cooking \u0026amp; Eating\u0027, p. 15\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As a result the best quality wheaten bread called \u0027\u0027pandemain\u0027\u0027 (\u0027panis dominis\u0027, or lord\u0027s bread), made from the finest flour, considered to be a luxury\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pandemonism", "{\"term\":\"pandemonism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|pan|demon|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Belief that every object (animate or inanimate), idea (abstract or concrete), and action is inhabited by its own independent supernatural spirit; worship of such spirits\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027, Charles Buck, \u0027A Theological Dictionary: Containing Definitions of All Religious and Ecclesiastical Terms\u0027, p. 291\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At all events, it is interesting to learn, from this work, with greater accuracy, an old religious system of the East, in which are to he found, with \u0027\u0027Pandemonism\u0027\u0027 and the metempsychosis, the elements of the worship of the stars, of astrology, the \u0027theurgy\u0027, the doctrine of amulets, as well as the elements of the Hindoo religion, particularly the system of castes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1910\u0027\u0027, Samuel Fallows, Andrew Constantinides Zenos, Herbert Lockwood Willett, \u0027The Popular and Critical Bible Encyclopædia and Scriptural Dictionary\u0027, p. 1481\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Every object, animate or inanimate, every idea, abstract or concrete, became endowed with a spirit of its own. The religion of Rome was a \u0027\u0027pandaemonism\u0027\u0027, a belief, not in one god, pervading all nature and identified with nature, but in millions of gods, a god for every object, every act\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Stephen Porter Dunn, \u0027Introduction to Soviet Ethnography\u0027, p. 491\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But he was scarcely right in attempting to derive all primitive religious concepts from an undifferentiated \u0026quot;dim \u0027\u0027pandemonism\u0027\u0027.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Robert Turcan, \u0027The Cults of the Roman Empire\u0027, page 121\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The dignity and calm of Isiac faith had something to impress anxious or fickle pagans who were beguiled by the murky occultism of the sects or the \u0027\u0027pandemonism\u0027\u0027 of the magicians\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Boris Jakim, \u0027The Comforter\u0027, p. 226\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"This peculiar anthropological docetism, or \u0027\u0027pandemonism\u0027\u0027, is not compatible with the Christian faith\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Belief in an universe that is infused with an evil spirit\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1927\u0027\u0027, Lewis Browne, Elsa Weihl, \u0027That Man Heine: A Biography\u0027, p. 257\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"It was but the original faith of the ancient ancient Teutons which the Christian monks had perverted into \u0027\u0027pandemonism\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Friedrich Schelling in Ernst Behler, \u0027Philosophy of German Idealism\u0027, p. 235\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"While this ancillary thought explains evil in the world, it also completely extinguishes the good and introduces \u0027\u0027pandemonism\u0027\u0027 instead of pantheism\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Robert Wicks, \u0027Literary Truth as Dreamlike Expression in Foucault\u0027s and Borges\u0027s \u0026quot;Chinese Encyclopedia\u0026quot;\u0027, in \u0027Philosophy and Literature\u0027, Vol. 27, No. 1, p. 80-97\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Whereas pantheism asserts that all is God, \u0027\u0027pandemonism\u0027\u0027 asserts that all is hell; whereas pantheism asserts that all is sacred and divine, \u0027\u0027pandemonism\u0027\u0027 asserts that all is profane and contaminated\", \"priority\":18}]}, \"synonyms\":{}}");

	add("pandemonium", "{\"term\":\"pandemonium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined by w:John Milton|John Milton in \u0026quot;Paradise Lost,\u0026quot; \u0027Pandæmonium\u0027, from Ancient greek (to 1453) \u0027πᾶν\u0027 (all) (equivalent to English pan-) + \u0027daemonium\u0027 (lang\u003dla) from Ancient greek (to 1453) \u0027δαίμων\u0027 (deity)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place where all demons live; Hell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1674\u0027\u0027 — w:John John Milton, \u0027s:Paradise Paradise Lost\u0027, Book\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And Trumpets sound throughout the Host proclaim\u0026lt;br/\u0026gt;A solemn Councel forthwith to be held\u0026lt;br/\u0026gt;At \u0027\u0027\u0027Pandæmonium\u0027\u0027\u0027, the high Capitol\u0026lt;br/\u0026gt;Of Satan and his Peers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Chaos; tumultuous or lawless violence\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027Boston Globe\u0027, October 2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Whenever you have violent \u0027\u0027pandemonium\u0027\u0027, there\u0027s the overwhelming possibility for panic and tragedy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An outburst; loud, riotous uproar, especially of a crowd\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pander", "{\"term\":\"pander\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"From Chaucer’s character \u0027w:pandarus\u0027 (in \u0027w:Troilus and Criseyde|Troilus and Criseyde\u0027), from Italian \u0027w:pandarus\u0027 (found in w:Boccaccio|Boccaccio), from Latin \u0027w:pandarus\u0027 from Ancient greek (to 1453) \u0027πάνδαρος\u0027 (See also Shakespeare’s wikibooks:Troilus and Cressida|Troilus and Cressida).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who furthers the illicit love-affairs of others; a pimp or procurer. (Later panderer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Moncrieff/Kilmartin/Enright, translating Marcel Proust, \u0027Swann’s Way\u0027, Folio Society 2005, p. 190\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was not only the brilliant phalanx of virtuous dowagers, generals and academicians with whom he was most intimately associated that Swann so cynically compelled to serve him as \u0027\u0027panders\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An offer of illicit sex with a third party\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An illicit or illegal offer, usually to tempt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who ministers to the evil designs and passions of another\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Those wicked \u0027\u0027panders\u0027\u0027 to avarice and ambition\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pandiculation", "{\"term\":\"pandiculation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pandiculate|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stretching and stiffening of the trunk and extremities, as when fatigued and drowsy or on waking, often accompanied by yawning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pandora", "{\"term\":\"pandora\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfelite|mul}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The first woman on earth, who had been given a box by the gods and instructed not to open it, but who disobeyed the instructions out of curiosity, releasing all manner of evils into the world\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A moon of the planet Saturn\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Short for , a main belt asteroid\", \"priority\":3}]}, \"synonyms\":{}}");

	add("panegyric", "{\"term\":\"panegyric\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027panégyrique\u0027 from Ancient greek (to 1453) \u0027πανηγυρικός\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formal speech or opus publicly praising someone or something\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paneity", "{\"term\":\"paneity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being bread\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panela", "{\"term\":\"panela\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"ancient greek (to 1453)\", \"Latin\", \"Portuguese\"], \"text\":\"From Old portuguese \u0027panela\u0027 \u0027panella\u0027 from {{m|la|*pannella}}, diminutive of the word \u0027panna\u0027 (frying pan) from Latin \u0027patīna\u0027 from Ancient greek (to 1453) \u0027πατάνη\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unrefined sugar product typical of Central and South America, which is basically a solid piece of sucrose and fructose obtained from the boiling and evaporation of sugarcane\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panelist", "{\"term\":\"panelist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|panel|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is a member of a panel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panelling", "{\"term\":\"panelling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The panels wherewith a surface (especially an indoor wall) is covered, considered collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHe looked round the poor room, at the distempered walls, and the bad engravings in meretricious frames, the crinkly paper and wax flowers on the chiffonier; and he thought of a room like Father Bryan\u0027s, with \u0027\u0027panelling\u0027\u0027, with cut glass, with tulips in silver pots, such a room as he had hoped to have for his own\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d3|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dHere the stripped \u0027\u0027panelling\u0027\u0027 was warmly gold and the pictures, mostly of the English school, were mellow and gentle in the afternoon light\", \"priority\":3}]}, \"synonyms\":{}}");

	add("panendeism", "{\"term\":\"panendeism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|panentheism|deism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"belief in a god who is both panentheistic and deistic, e.g. a god who contains all of the universe, but who nevertheless transcends or has some existence separate from the universe, who does interact, but does not necessarily intervene in the universe, and that a personal relationship can be achieved with it, in as much as a person can have a relationship with his/her own rational thoughts. Contrasted from Panentheism in that the existence of, and relationship with, the creator god (or prime mover) is determined from observance of nature, not rationality and thought\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He describes his current spiritual position as \u0026quot;\u0027pandeism\u0027 or \u0027\u0027 \u0027pan-en-deism\u0027 \u0027\u0027, something very close to the Native American concept of the all- pervading Great Spirit\u0026quot;\u0027. \u0026quot;Marine\u0027s Balled Honors Soldiers, Trappist Monks\u0026quot; \u0027Albuquerque Journal\u0027 (Saturday, November 11, 1995) B-10\", \"priority\":2}]}, \"synonyms\":{}}");

	add("panentheism", "{\"term\":\"panentheism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Karl Christian Friedrich Krause|Karl Christian Friedrich Krause in 1828 as {{prefix|pan|lang\u003den}} {{prefix|en|theism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A doctrine that the universe subsists within God, but that God nevertheless transcends or has some existence separate from the universe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1874\u0027\u0027, w:Robert Robert Flint, \u0027The Philosophy of History in France and Germany\u0027, p. 484\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The third great age of humanity (\u0027das Reifalter\u0027) is that in which all its powers are fully and harmoniously developed... and in which \u0027\u0027panentheism\u0027\u0027 is universally and cordially accepted as the only true and adequate doctrine either of science or of society\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, w:Benito Pérez Benito Pérez Galdós, \u0027Doña perfecta\u0027, p. 84\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Pantheism or \u0027\u0027panentheism\u0027\u0027... is condemned by the Church, as well as by the teachings of Schopenhauer and of the modern Hartmann\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, w:Charles Charles Hartshorne, \u0027Man\u0027s Vision of God and the Logic of Theism\u0027, p. 348\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This panentheistic doctrine contains all of deism and pandeism except their arbitrary negations. Thus ARCW, or absolute-relative \u0027\u0027panentheism\u0027\u0027, is the one doctrine that really states the whole of what all theists, if not all atheists as well, are implicitly talking about\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A belief in all gods\", \"priority\":8}]}, \"synonyms\":{}}");

	add("panentheist", "{\"term\":\"panentheist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who believes in panentheism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paneosteitis", "{\"term\":\"paneosteitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pan|osteitis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long bone condition in large dogs, manifesting with sudden, otherwise unexplained pain and lameness sometimes shifting from leg to leg\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panethnicity", "{\"term\":\"panethnicity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pan|ethnicity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The grouping together, and collective labelling, of various separate ethnicities\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pangaea", "{\"term\":\"pangaea\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From \u0027pan-\u0027 + \u0027γαῖα\u0027 (earth, land) probably after German \u0027pangäa\u0027 coined by w:Alfred Wegener|Alfred Wegener in 1915.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supercontinent that included all the landmasses of the earth before the Triassic period and that broke up into Laurasia and Gondwana\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pangasius", "{\"term\":\"pangasius\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various edible freshwater fish of the genus \u0027Pangasius\u0027, native to southeast Asia, especially the iridescent shark\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pangene", "{\"term\":\"pangene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supposed particle with which heritable character was transmitted during cell division\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pangram", "{\"term\":\"pangram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παν\u0027 (everything) + \u0027γράμμα\u0027 (letter) thus \u0026quot;all letters\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sentence that contains every letter of the alphabet, such as \u0026quot;The quick brown fox jumps over the lazy dog\u0026quot; in English\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027 (605 m)\u0027, Tony Augarde, \u0027The Oxford Guide to Word Games\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Like the search for the perfect palindrome, the pursuit of the perfect \u0027\u0027pangram\u0027\u0027 has obsessed many people\", \"priority\":3}]}, \"synonyms\":{}}");

	add("panhandler", "{\"term\":\"panhandler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Obscure. Speculative. Panhandling always seems to involve a container for receiving loose change, so perhaps referring to a small, handled pan or to the container as the pan and the arm[s] holding it as the handle.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who panhandles; an urban beggar who typically stands on a street with an outstretched container in hand, begging for loose change\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A bum\", \"priority\":2}]}, \"synonyms\":{}}");

	add("panko", "{\"term\":\"panko\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"From Japanese \u0027lang\u003dja\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Coarse, dry breadcrumbs used in Japanese cuisin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panmixia", "{\"term\":\"panmixia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"from Ancient greek (to 1453) \u0027πᾶς\u0027 (lang\u003dgrc) + \u0027μίξις\u0027 (lang\u003dgrc) + Latin \u0027-ia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A situation in which an individual is just as likely to mate with another randomly chosen individual as any other in the population\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panmixis", "{\"term\":\"panmixis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"from Ancient greek (to 1453) \u0027πᾶς\u0027 (lang\u003dgrc) + \u0027μίξις\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Panmixia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panmixus", "{\"term\":\"panmixus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Panmixia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pannexin", "{\"term\":\"pannexin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pan|nexin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any member of a family of transmembrane proteins found in vertebrates, homologous to the invertebrate innexins\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panniculus", "{\"term\":\"panniculus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dense layer of fatty tissue growth, consisting of subcutaneous fat in the lower abdominal area\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pannier", "{\"term\":\"pannier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027panier\u0027 from Latin \u0027pānārium\u0027 (a bread basket) from \u0027pānis\u0027 (bread)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large basket or bag fastened, usually in pairs, to the back of a bicycle or pack animal, or carried in pairs over the shoulders\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A decorative basket for the display of flowers or fruits\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of a pair of hoops used to expand the volume of a woman\u0027s skirt to either side\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pannikin", "{\"term\":\"pannikin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pan|kin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cup or other vessel used for drinking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, w:George George Orwell, \u0027w:Homage to Homage to Catalonia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is all bound up in my mind with the winter cold, the ragged uniforms of militiamen, the oval Spanish faces, the morse-like tapping of machine-guns, the smells of urine and rotting bread, the tinny taste of bean-stews wolfed hurriedly out of unclean \u0027\u0027pannikins\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The contents of such a vessel\", \"priority\":4}]}, \"synonyms\":{}}");

	add("panocracy", "{\"term\":\"panocracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|pano|cracy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Rule by all\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The principle that everyone has the right to participate in the making of decisions that affect them and no one has the right to assume someone else\u0027s authority for the decisions they make\", \"priority\":2}]}, \"synonyms\":{}}");

	add("panoply", "{\"term\":\"panoply\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|grc|πανοπλία|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A splendid display of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, J. A. Philip, \u0026quot;Mimesis in the \u0027Sophistês\u0027 of Plato,\u0026quot; \u0027Transactions and Proceedings of the American Philological Association\u0027, vol. 92, p. 459\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even though we cannot affirm that the products of mimesis are invested in the \u0027\u0027panoply\u0027\u0027 of existence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a collection or display of weaponr\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ceremonial garments, complete with all accessories\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A complete set of armour\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something that covers and protects\", \"priority\":7}]}, \"synonyms\":{}}");

	add("panorama", "{\"term\":\"panorama\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{prefix|pan|gloss1\u003dall|lang\u003den}} Ancient greek (to 1453) \u0027ὅραμα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unbroken view of an entire surrounding area\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dHe stood transfixed before the unaccustomed view of London at night time, a vast \u0027\u0027panorama\u0027\u0027 which reminded him [\u0026amp;hellip;] of some wood engravings far off and magical, in a printshop in his childhood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A picture or series of pictures representing a continuous scene\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; a comprehensive survey\", \"priority\":4}]}, \"synonyms\":{}}");

	add("panphobia", "{\"term\":\"panphobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|pan|phobia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the fear of everythin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"by confusion with panophobia) a condition of groundless fears\", \"priority\":2}]}, \"synonyms\":{}}");

	add("panpipes", "{\"term\":\"panpipes\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Pan (Greek god of nature, often visualized as half goat and half man) + pipes.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instrument consisting of a series of ten or more tubes of different lengths, typically closed at the bottom and open at the top. The instrument is played by blowing across the open end at the top\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panpsychism", "{\"term\":\"panpsychism\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"Greek\", \"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Formed by the prefixation of {{prefix|pan|psychism|lang\u003den}} after the German \u0027panpsychismus\u0027 (1874), itself after the Latin \u0027pampsychia\u0027 (1591). Compare the Ancient greek (to 1453) \u0027πάμψυχος\u0027 (in full life) and the Modern Greek \u0027παμψυχισμός\u0027 (panpsychism)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The that all has a mental\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A specific panpsychist doctrine or system\", \"priority\":2}]}, \"synonyms\":{}}");

	add("panromantic", "{\"term\":\"panromantic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pan|romantic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is panromantic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panromanticism", "{\"term\":\"panromanticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|panromantic|ism}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being panromantic, that is to be romantically attracted to people regardless of genders\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panselectionism", "{\"term\":\"panselectionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The theory that natural selection acting on genetic variation is virtually the only acceptable mechanism of evolutionary change\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pansentience", "{\"term\":\"pansentience\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"macaronic|Macaronic ad-hoc formation of Ancient greek (to 1453) {{m|grc|πᾶν||all}} and Latin {{m|la|sentiēns}}, present participle of {{m|la|sentiō||feel, sense}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The concept of all things having sentience\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Arturo Escobar, \u0027Territories of Difference: Place, Movements, Life, Redes\u0027, page 29\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If language and meaning, as some of these biologists suggest, are properties of all living beings and not only of humans—that is, if the world is one of \u0027\u0027pansentience\u0027\u0027—can activists and others learn to become “readers of the book of life” and avail themselves of this reading to illuminate their reveries and strategies\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, M. R. Redclift, ‎Graham Woodgate, \u0027The International Handbook of Environmental Sociology\u0027, page 101\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some (e.g. Goodwin, 2007) go further to suggest that language and meaning are properties of all living beings and not only of human beings – in other words, that the world is one of \u0027\u0027pansentience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Madhusudan Sakya, \u0027Current Perspectives in Buddhism\u0027, page 158\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"To sum up, the universe is the thoughtform of the collective mindstream of all sentient beings (and there is nothing which is non-sentient; \u0027\u0027pansentience\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pansexuality", "{\"term\":\"pansexuality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|pansexual|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sexual orientation characterized by the potential for aesthetic attraction, romantic love and/or sexual desire for people, regardless of their gender identity or biological sex\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pansophy", "{\"term\":\"pansophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Originally from Greek \u0027pan\u0027, all, and \u0027-sophy\u0027, wisdom or knowledge, then from Latin \u0027pansophia\u0027 to English.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Universal (complete) knowledge or a system of such universal knowledge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pansori", "{\"term\":\"pansori\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Korean\"], \"text\":\"From Korean \u0027lang\u003dko\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traditional Korean style of narrative song, in which a single performer is accompanied by a drummer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pansteatitis", "{\"term\":\"pansteatitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A physiological condition in animals, characterised by inflammation of the body fat\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panto", "{\"term\":\"panto\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Short form of pantomim\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Short form of pantograph\", \"priority\":2}]}, \"synonyms\":{}}");

	add("panty", "{\"term\":\"panty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Recorded since 1845 in the plural, meaning \u0026quot;drawers for men\u0026quot;, a derogatory diminutive of pants (the shortening of pantaloons); meaning \u0026quot;underpants for women or children\u0026quot; first recorded 1908.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Short trousers for men, or more usually boys\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An article of clothing worn as underpants by women\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027 October 13, Advertisement, \u0027w:Life Life\u0027, [http://books.google.com.au/books?id\u003d3lIEAAAAMBAJ\u0026amp;pg\u003dPA13\u0026amp;dq\u003d%22panty%22+-intitle:%22panty%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dTubNT--SM86uiQee__mpDA\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22panty%22%20-intitle%3A%22panty%22\u0026amp;f\u003dfalse page 13\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"For, unlike old-fashioned diapers, PLAYTEX \u0027Dryper\u0027 confines all wetness to the \u0027\u0027panty\u0027\u0027 area; brings your baby a whole new world of comfort plus cleaner, finer protection\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027Glamour\u0027, Volume 101, Issues 4-6, [http://books.google.com.au/books?id\u003dTvTxAAAAMAAJ\u0026amp;q\u003d%22panty%22+-intitle:%22panty%22\u0026amp;dq\u003d%22panty%22+-intitle:%22panty%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dTubNT--SM86uiQee__mpDA\u0026amp;redir_esc\u003dy page number unknown\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“One time I was going to run and change before a concert because I realized I had \u0027\u0027panty\u0027\u0027 lines showing,” says Britta Phillips\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Dan S. Kennedy, Jason Marrs, \u0027No B.S. Price Strategy\u0027, [http://books.google.com.au/books?id\u003dqkzyV0GIonQC\u0026amp;pg\u003dPA54\u0026amp;dq\u003d%22panty%22+-intitle:%22panty%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dTubNT--SM86uiQee__mpDA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22panty%22%20-intitle%3A%22panty%22\u0026amp;f\u003dfalse page 54\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That puts their \u0027\u0027panty\u0027\u0027 well over 1000% higher priced than the Hanes \u0027\u0027panty\u0027\u0027 and roughly 300% higher priced than the Victoria′s Secret \u0027\u0027panty\u0027\u0027. All three are cotton bikini \u0027\u0027panties\u0027\u0027. Not much difference in the actual \u0027\u0027panty\u0027\u0027 but a huge discrepancy in prices\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A helmet cover\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Alex Cohen, Jennifer Barbee, \u0027Down and Derby: The Insider\u0027s Guide to Roller Derby\u0027, [http://books.google.com.au/books?id\u003dzucuSTxMuzgC\u0026amp;pg\u003dPT106\u0026amp;dq\u003d%22panty%22+%22roller+OR+derby%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dvQTOT_PXGabYigfCs4SODA\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22panty%22%20%22roller%20OR%20derby%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"There is a special play called “Passing the Star” that allows the jammer to remove her helmet \u0027\u0027panty\u0027\u0027 and hand it over to the pivot\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Pamela Ribon, \u0027Going in Circles\u0027, %22helmet+panties%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwA3OT6SAMqfFmQX0ws2uCg\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22helmet%20panties%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 200\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"We′re practicing this strategy right now. Francesca is the Jammer, and she′s supposed to pass me the helmet \u0027\u0027panty\u0027\u0027. Bruisey-Q is assisting her, helping her get through the pack by knocking the formidable ass of ThunderSmack out of the way\", \"priority\":17}]}, \"synonyms\":{}}");

	add("pantalettes", "{\"term\":\"pantalettes\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of long underpants with a frill at the bottom of each le\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, w:M. Barnard M. Barnard Eldershaw, \u0027w:A House is A House Is Built\u0027, Chapter IX, Section iii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the second row of the cavalcad\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"cavalcade were Francie, Fanny\u0027s god-daughter, now thirteen years old and already elegant in long frilled \u0027\u0027pantalettes\u0027\u0027, tarta\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"tartan skirts, and a w:Leghorn leghorn hat with streamers, Category:en:Underwear\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pantechnicon", "{\"term\":\"pantechnicon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From w:Pantechnicon|Pantechnicon, a building in Motcomb Street, London.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A depository or place where all sorts of manufactured articles are collected for sale\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A van, especially a large removal van. Originally\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Livia\u0027, Faber \u0026amp; Faber 1992 (\u0027Avignon Quintet\u0027), p. 426\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In fact, as they later found, the auxiliary vehicle was a very large removers\u0027 van – the kind known as a \u0027\u0027pantechnicon\", \"priority\":4}]}, \"synonyms\":{}}");

	add("panthea", "{\"term\":\"panthea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027: Ton Derks, \u0027Gods, Temples and Ritual Practices: The Transformation of Religious Ideas and Values in Roman Gaul\u0027, [http://books.google.co.uk/books?id\u003dFSLbNelH1GQC\u0026amp;pg\u003dPA78\u0026amp;dq\u003dpantheon+panthea\u0026amp;ei\u003d-951SqrwJYmGzAS-9dnnA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dpantheon%20panthea\u0026amp;f\u003dfalse page 78] ([http://www.aup.nl/do.php?a\u003dshow_visitor_book\u0026amp;isbn\u003d9053562540\u0026amp;l\u003d2 Amsterdam University Press]; ISBN 9789053562543\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As an alternative for Dumézil’s functional classification, Oosten suggests a classification in terms of kinship relations. Such an approach corresponds to the perspective of the participants and enables the researcher to define not only the place of a god in the pantheon, but also his \u0027relation\u0027 to other members of the pantheon. Our information, however, is so insufficient that there can be no question of any reconstruction of the complete \u0027\u0027panthea\u0027\u0027, let alone of the various kinship ties between their members. Yet we can take advantage of Oosten’s observations. First, the conclusion that kinship is the primary organizing principle in all Indo-European \u0027\u0027panthea\u0027\u0027 may draw our attention to the importance of relationships between male and female deities. If, as we shall see, the epigraphical sources give the impression that male and female cults were strictly separated, all to radical inferences are better avoided. Second, from Oosten’s proposition the important conclusion may be drawn that the introduction of \u0027new\u0027 gods was also conceptualized in terms of kinship\", \"priority\":3}]}, \"synonyms\":{}}");

	add("panther", "{\"term\":\"panther\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027pantere\u0027 (modern \u0027panthère\u0027 , from Latin \u0027panthera\u0027 from Ancient greek (to 1453) \u0027πάνθηρ\u0027 (panther)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various big cats with black fur; most especially, the black-coated leopard of India\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any big cat of the genus \u0027Panthera\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A cougar; especially the\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pantile", "{\"term\":\"pantile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|pan|tile|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of interlocking roof tile with a rounded under and over, giving it an elongated S shape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Richard Fortey, \u0027The Earth\u0027, Folio Society 2011, p. 103\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All the gneiss roofing slates have vanished, to be replaced by \u0027\u0027pantiles\u0027\u0027 painting patchworks of all possible orange hues\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"date\u003d26 October passage\u003dSome old, underfired clay \u0027\u0027pantiles\u0027\u0027 might be damaged by button mosses rooting in cracks and fissures. But most post-war tiles are hard enough to withstand a bit of moss growth\", \"priority\":4}]}, \"synonyms\":{}}");

	add("pantisocracy", "{\"term\":\"pantisocracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|panto|isocracy|alt1\u003dpant(o)|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A utopian social system in which every member participates equally in government\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantoate", "{\"term\":\"pantoate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pantoic|ate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A salt or ester of pantoic acid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantofle", "{\"term\":\"pantofle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027pantoufle|lang\u003dfrm\u0027 () of uncertain origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slipper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"III.2.1.i\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And although she threatened to break his bow and arrows, to clip his wings, and whipped him besides on the bare buttocks with her \u0027\u0027pantofle\u0027\u0027, yet all would not serve\u0026amp;nbsp;[…\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pantograph", "{\"term\":\"pantograph\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027pantographe\u0027 from \u0027panto-\u0027 (from Ancient greek (to 1453) \u0027παντός\u0027 genitive singular of \u0027πᾶν\u0027 (lang\u003dgrc) and \u0027-graphe\u0027 (from \u0027γράφειν\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mechanical linkage based on parallelograms causing two objects to move in parallel; notably as a drawing aid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027pantograph\u0027\u0027 can be adjusted to make either scaled or exact copies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A pattern printed on a document to reduce the ease of photocopying\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I was impressed by the quality of the \u0027\u0027pantograph\u0027\u0027; I hadn\u0027t noticed it on the original, but the copies were covered in unpleasant lines\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A similarly-formed conductive device, now usually Z-shaped, that collects electric current from overhead lines for trains and trams\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pantology", "{\"term\":\"pantology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|panto|logy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A systematic view of all branches of human knowledge or a work of universal information\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantometry", "{\"term\":\"pantometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proposed scheme for universal measurement\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantomime", "{\"term\":\"pantomime\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Circa 17th century, from Latin \u0027pantomīmus\u0027 from Ancient greek (to 1453) \u0027παντόμιμος\u0027 from \u0027πᾶς\u0027 (each, all) + \u0027μιμέομαι\u0027 (i mimic)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Classical comic actor, especially one who works mainly through gesture and mime\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He] saw a \u0027\u0027pantomime\u0027\u0027 perform so well that he could follow the performance from the action alone\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The drama in ancient Greece and Rome featuring such performers; or (later) any of various kinds of performance modelled on such work\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A traditional theatrical entertainment, originally based on the commedia dell\u0027arte, but later aimed mostly at children and involving physical comedy, topical jokes, and fairy-tale plots\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Gesturing without speaking; dumb-show, mime\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, w:Herman Herman Melville, \u0027w:Moby Moby Dick\u0027, s:Moby-Dick/Chapter chapter 2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A staid, steadfast man, whose life for the most part was a telling \u0027\u0027pantomime\u0027\u0027 of action, and not a tame chapter of sounds\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 26\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027pantomime\u0027\u0027, Chief Joyi would fling his spear and creep along the veld as he narrated the victories and defeats\", \"priority\":9}]}, \"synonyms\":{}}");

	add("pantophagy", "{\"term\":\"pantophagy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diet that consists of a variety of foods\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantophobia", "{\"term\":\"pantophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|panto|phobia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the fear of everythin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"by confusion with panophobia) a condition of groundless fears\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pantoprazole", "{\"term\":\"pantoprazole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proton pump inhibitor drug, used for treatment of erosion and ulceration of esophagus caused by gastroesophageal reflux disease\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantropy", "{\"term\":\"pantropy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by science-fiction writer James Blish in the 1950s for his short-story collection \u0027The Seedling Stars\u0027.[http://books.google.com/books?id\u003d3JXnz9x9sO4C\u0026amp;pg\u003dPA581]\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of adapting humans through genetic or cybernetic means to thrive in environments otherwise inhospitable to them, such as outer space, the deep sea or other planets\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pantry", "{\"term\":\"pantry\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027paneterie\u0027 related to Latin \u0027panis\u0027 (bread)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small room, closet, or cabinet usually located in or near the kitchen, dedicated to food storage and/or storing kitchenware. Since the pantry is not typically temperature-controlled (unlike a refrigerator or root cellar), the foods stored in a pantry are usually shelf-stable staples such as grains, flours, and preserved foods\", \"priority\":1}]}, \"synonyms\":{}}");

	add("panzoism", "{\"term\":\"panzoism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|pantheism|zoology|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Belief that the entire universe is a living thing, or is suffused with life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1875\u0027\u0027, James McCosh, \u0027Ideas in Nature Overlooked by Dr. Tyndall\u0027, p.37\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He holds that there is a pangenesis or \u0027\u0027panzoism\u0027\u0027 in all animated being. Now, what is this but the \u0026quot;life\u0026quot; of the old zoologists whom they so ridicule\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Edward Gleason Spaulding, \u0027The New Rationalism\u0027, p.34\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But there [is] also \u0027\u0027panzoism\u0027\u0027, maintaining that the universe is a living being and has a soul, and anti-intellectualism, holding that genuine intellectual analysis is impossible, both because each thing is infinitely complex and because the removal of a part alters its causal context\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, David Skrbina, \u0027Panpsychism In The West\u0027, p. 220\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Why Carus did not use \u0027hylozoism\u0027 is not clear. Regardless, that term is now rarely used, as is also true of the variation \u0027\u0027panzoism\", \"priority\":7}]}, \"synonyms\":{}}");

